reviews:
룸이 있고 주차 편한거 생각해서 가족모임 장소로 정했는데 매장도 생각한거보다 전체적으로 칙칙하고, 음식이 비주얼에 비해 맛있다는 느낌은 아니라서 좀 그랬어요. 음식 하나하나 정성보다는 대충 가짓수랑 구성 짜맞추기식 느낌.

그래도 룸일식집이고 나름 고급?포지션을 잡고 있는 곳이라 생각했는데, 서빙하는 분들의 태도나 풍기는 느낌은 너무 싼마이라 결코 적은 돈이 아닌데 대접 못받는 기분이었어요. 아 불친절하고 그런건 아닌데 그냥 막말로 어디 술집 온 느낌;;;

평소 같으면 한마디 했을텐데 진짜 오랜만에 하는 가족모임이라 분위기 망치기 싫어서 조용히 넘어갔는데 다시는 안갈거 같아요.
